import React from "react";
import { card } from "../utiles/inter";
import { images } from "../utiles/Utiles";
import styled from "styled-components";
import a from '../assets/image/base/attack.png'


interface CardProps {
    card: card | undefined;
    
}


const Card: React.FC<CardProps> = ({card}) => {
    return <CardStyled className="card">
        {Object.entries(images).map(([key, src], index) => (
          <img key={index} src={src} alt={key} />))}
        <img src={a} alt="" />
    </CardStyled>
}

export default Card


const CardStyled =  styled.div`
    border: 1px solid black;
`
